import React from "react";

function Navbar() {
  return (
    <header className="header container">
      <h2>Home Decor</h2>
      <nav className="nav">
        <ul className="nav-list">
          <li className="nav-item">Home</li>
          <li className="nav-item">Contacts</li>
          <li className="nav-item">About</li>
        </ul>
      </nav>
    </header>

  );
}

export default Navbar;
